import React from "react";
import styles from './Calendar.module.css';

const Calendar = props =>{

    return(
        <div clasName={styles.calContainer}>
            <div>Deadlines this month</div>
            <div>Calendar here</div>
        </div>
    );
}

export default Calendar;
